import { StyleSheet, Text, Button,View, SafeAreaView, Alert } from 'react-native';

export default function App() {
  const handleTengellaPress=()=>Alert.alert("Tengella",[
    {text:"Ja", onPress:()=>console.log("Ja knapp")},
    {text:"Nej", onPress:()=>console.log("Nej knapp")}

  ]);

  return (
    <SafeAreaView style={styles.container}>

      <Text style={styles.header}>Cleaning Support</Text>


      <Button style={styles.button}
        title="Tengella"
        color="#4682B4"
        onPress={() => Alert.alert("Tengella",[
          {text:"Ja", onPress:()=>console.log("Ja knapp")},
          {text:"Nej", onPress:()=>console.log("Nej knapp")}
        ])}
      />

<Button

        title="Nyhetsflöde"
        color="#4682B4"
        onPress={() => Alert.alert('Simple Button pressed')}
      />

<Button
        title="Mina sidor"
        color="#4682B4"
        onPress={() => Alert.alert('Simple Button pressed')}
      />

<Button
        title="Förbrukningsmaterial"
        color="#4682B4"
        onPress={() => Alert.alert('Simple Button pressed')}
      />

<Button
        title="Kalender"
        color="#4682B4"
        onPress={() => Alert.alert('Simple Button pressed')}
      />

<Button
        title="Personalhandbok"
        color="#4682B4"
        onPress={() => Alert.alert('Simple Button pressed')}
      />

<Button
        title="Blanketter vid olycka"
        color="#4682B4"
        onPress={() => Alert.alert('Simple Button pressed')}
      />

<Button
        title="Arbetsmiljöhandbok"
        color="#4682B4"
        onPress={() => Alert.alert('Simple Button pressed')}
      />
     <StatusBar style="auto" />
    </SafeAreaView>
  );
}

